import React from "react"
import Thumbnail from './Thumbnail.js'; 
import './App.css';

function Projects(props) {
  return (
    <div>
      <h1>Projects</h1>
      <Route exact path='/' component={Projects} />

      <Thumbnail
        link="/freelancecrm"
        image="http://twitter-image-url.jpg"
        title="Freelance CRM"
        category="Web App"
      />
    </div>
  )
}

export default Projects;
